import { Tooltip } from "react-tooltip";
import styles from "./Superpowers.module.css";

export function PiphanyPower() {
  return (
    <>
      <Tooltip id="piphanyTooltip" place="top" type="dark" effect="float">
        <span>
          Суперсила "Прозрение": на 5 секунд показываются все карты. Таймер длительности игры на это время
          останавливается.
        </span>
      </Tooltip>
      <div className={styles.superpowerContainer}>
        <img
          className={styles.superpowerIcon}
          src="../power-piphany.svg"
          alt="Суперсила прозрение"
          data-tip
          data-for="piphanyTooltip"
        />
      </div>
    </>
  );
}
